	public static double getNum(double[] db){
		double num=0;
		for(int i=0;i<db.length;i++){
			num+=db[i];
		}
		return num;
	}
	
	public static int getNum(int[] db){
		int num=0;
		for(int i=0;i<db.length;i++){
			num+=db[i];
		}
		return num;
	}
	
	public static boolean isCommon(String[] str1,String[] str2){
		if(str1.length!=str2.length){
			return false;
		}
		if(str1.length<100){
			for(int i=0;i<str1.length;i++){
				if(!str1[i].equals(str2[i])){
					return false;
				}
			}
		}else{
			int i=0;
			while(i<100){
				int index=(int)(Math.random()*str1.length);
				if(!str1[index].equals(str2[index])){
					return false;
				}
				i++;
				}
		}
		return true;
	}
	
	public int[] getBarHeight(double[] db,int length){
		
		int[] dv=new int[length];
		barEnd=getMax(db);
		barStart=getMin(db);
		barWidth=(barEnd-barStart)/length;
		for(int i=0;i<db.length;i++){
			if(db[i]==barEnd){
				dv[dv.length-1]+=1;
			}else{
				dv[(int)((db[i]-barStart)/barWidth)]+=1;
			}
		}
		return dv;
	}
	
	public static double getMin(double[] db){
		double min=10000;
		for(int i=0;i<db.length;i++){
			min=Math.min(min, db[i]);
		}
		return min;
	}
	
	public static double getMax(double[] db){
		double max=0;
		for(int i=0;i<db.length;i++){
			max=Math.max(max, db[i]);
		}
		return max;
	}
	
	public static int getMax(int[] db){
		int max=0;
		for(int i=0;i<db.length;i++){
			max=Math.max(max, db[i]);
		}
		return max;
	}
	
	public static double getMaxs(double[][] db){
		
		double max=0;
		for(int i=0;i<db.length;i++){
				max=Math.max(max, getMax(db[i]));
		}
		return max;
	}
	
	public static double getAvg(double[] X){
		double avg=0;
		for(int i=0;i<X.length;i++){
			avg+=X[i];
		}
		if(X.length>0){
			avg=avg/X.length;
		}
		return avg;
	}
	
	public static double getStd(double[] X){
		double avg=getAvg(X);
		double std=0;
		for(int i=0;i<X.length;i++){
			std+=(X[i]-avg)*(X[i]-avg);
		}
		if(X.length>0){
			std=std/X.length;
		}
		return Math.sqrt(std);
	}

